import React from "react";
import {
    withScriptjs,
    withGoogleMap,
    GoogleMap,
    Marker
} from "react-google-maps";
import {useDispatch, useSelector} from "react-redux";
import {getRouteProps} from "../redux/apiMobileV2/ApiMobileV2Action";


function RouteProps() {

    const dispatch = useDispatch();
    const data = useSelector(state => state.apiMobileV2Reducer.routePropsData);
    const status = useSelector(state => state.apiMobileV2Reducer.routePropsStatus);
    React.useEffect(() => {
        dispatch(getRouteProps())
    }, []);
    console.log(data)

    const CustomSkinMap = withScriptjs(
        withGoogleMap(() => (
            <GoogleMap
                defaultZoom={13}
                defaultCenter={{lat: 41.320052, lng: 69.253966}}
                defaultOptions={{
                    scrollwheel: false,
                    zoomControl: true,
                }}
            >
                <Marker position={{lat: 41.320052, lng: 69.253966}}/>
            </GoogleMap>
        ))
    );
}

export default function Maps() {
    return (
        <RouteProps
